import React, { Component } from 'react'
import { Container, Row, Col } from 'reactstrap';
import { Link } from 'react-router-dom';

class Visit extends Component {
	constructor(props) {
		super(props);
	}
	render(){
		return (<Container>
			<Row className={(this.props.visitRecord.hasViolation?'violation':'')}>
				<Col>{this.props.visitRecord.date}</Col>
				<Col>
					<pre>{JSON.stringify(this.props.visitRecord,null,2)}</pre>
				</Col>
			</Row>
		</Container>)
	}
}

export default Visit;
